    - test:
        if: "$SpeechStyle != 'ClearSpeak' or $ClearSpeak_MultSymbolX = 'Auto'"
        then: [t: "ganger"]                         #   (en: 'times', google translation)
        else_test:
            if: $ClearSpeak_MultSymbolX = 'By'
            then: [t: "av"]                         #   (en: 'by', google translation)
            else: [t: "gangetegn"]                  #   (en: 'cross', google: 'kryss')
